import React from "react";
import AboutMain from 'components/organisms/AboutMain';
import AboutTeam from 'components/organisms/AboutTeam';
import AboutSolution from 'components/organisms/AboutSolution';

import { Link } from 'react-router-dom'
const About = () => {

  return (
    <nav>
       <ul className="ul">
        <Link to='/about-luminouss/main'>
          <AboutMain />
        </Link>
        <Link to='/about-luminouss/team'>
          <AboutTeam />
        </Link>
        <Link to='/about-luminouss/solution'>
          <AboutSolution />
        </Link>
       </ul>
    </nav>
  );
}

export default About;
